// helper functions
function getCsvLines($content) {
	$lines = explode("\n", $content);
	$out = [];
	foreach ($lines as $line) {
		$line = trim($line);
		if (!empty($line) && $line[0] != '//' && $line[0] != '#') {
			$out[] = $line;
		}
	}
	
	return $out;
}


